window.bookSummaryJSON = "<p>When Kate and Nathan receive a photo of four kidnapped models, the clock starts ticking for the detectives to save their lives before it’s too late.</p> <p>Kate has been on the Murder Team for a few months now, working run-of-the-mill cases with Nathan. But the memory of that first case, and it's disturbing details, still bothers her.</p> <p>Meanwhile, four models arrive at a shoot in a local abandoned mental asylum and are violently kidnapped.</p> <p>The next day, a photo of them lands on the desk of Kate and Nathan, with a chilling note.</p> <p>Fearing their imminent murders, the detectives begin the hunt for the missing models, delving into the photography community within Surrey, and the complex, fractious relationships between the photographers and models.</p> <p>As the hours pass, evil influences raise their heads once more, and the pressure to save as many of the girls as possible grows.</p> <p>But when links to Kates first case on the Murder Team become apparent, she begin's to wonder if there really is more going on here than meets the eye.</p>"; 
